/* eslint-disable no-unused-vars */
import React, {useState , useEffect} from 'react'

function Aplicacao(){  

    //armazenar dados
    const [ presidente, setPresidente] = useState([])

    //pega dados

    // /*{presidente.map(candidato => (<li key={candidato.nc}>{candidato.p}</li>))}*/
    useEffect(() => {
        Dados()
    }, []) 

    const Dados = async () => {
        const dadosRepo = await fetch ('https://infograficos-eleicoes-oglobo.s3.amazonaws.com/2022/1-turno/apuracao/presidente/presidente_brasil.json')

        const coverter = await dadosRepo.json()

        setPresidente(coverter)
    }

    return(
        <div>
          <table>

          <tr>
                <th>Nome Candidato</th>
                <th>Partido</th>
                <th>Quantidade de votos</th>
            </tr>
            {presidente?.map((carro,index)=> (
                    <tr>
                      <td key={`nome-${index}`}>{carro.nome}</td>
                        <td key={`placa-${index}`}>{carro.placa}</td>
                        <td key={`data-${index}`}>{carro.dataEntrada}</td>
                    </tr>

                    ))} 

            </table>



       </div>
    )

} 


export default Aplicacao
